const entrada = $input.all();

// Função para normalizar o fuso horário para Brasília
function formatarDataBrasilia(dataUTC) {
  const data = new Date(dataUTC);
  data.setUTCHours(data.getUTCHours() - 3); // UTC-3
  return data.toLocaleString('pt-BR');
}

const output = entrada.map(item => {
  const d = item.json;

  const perguntas = [
    { numero: 4, nome: 'Plano de negócios', valor: d["Plano de negócios"] },
    { numero: 5, nome: 'TamSamSom', valor: d.TamSamSom },
