    { numero: 9, nome: 'Pitch', valor: d.Pitch },
    { numero: 10, nome: 'Programas', valor: d.Programas }
  ];

  // Identificar última pergunta respondida
  let ultimaResposta = '0 - Nenhuma pergunta respondida';
  for (let i = perguntas.length - 1; i >= 0; i--) {
    if (perguntas[i].valor !== null && perguntas[i].valor !== undefined) {
      ultimaResposta = `${perguntas[i].numero} - ${perguntas[i].nome}`;
